import { connect } from "react-redux";

function Users({ users }) {
    return (
        <section className="users">
            <div className="users__inner">
                <div className="users__wrapper">
                    <p className="users__text">{users[4].quote}</p>
                    <span className="users__name">{users[4].name}</span>
                    <span className="users__job">{users[4].job}</span>
                    <ul className="users__list">
                        {users.map(user => {
                            return (
                                <li className="users__list-item">
                                    <img className="users__list-img" src={user.photo} ></img>
                                </li>
                            )
                        })}
                    </ul>
                </div>
            </div>
        </section>

    )
}

const mapStateToProps = (state) => ({
    users: state.users
})

export default connect(mapStateToProps)(Users)
